import React from "react";
import {
  AccountCircleIcon,
  MicrosoftLogo,
  NotificationsFilledIcon,
} from "../../assets/icons";
import { Header, IconButton } from "intelli-ui-components-library";
import styles from "./topNavbar.module.scss";
import { fiservLogo } from "../../assets/fiservLogo.png";

const TopNavbar = () => {
  return (
    <>
      <Header
        //brandLogo={"https://www.drupal.org/files/intelliswift.png"}
        brandLogo={"../../assets/fiserv-logo.png"}
        elevation={1}
      ></Header>
    </>
  );
};

export default TopNavbar;
